package com.audaxis.compiere.eurocenter.process.model;

import java.io.File;

public class ImportInvoiceFile {

	private File file;
	private String Type;
	
	public ImportInvoiceFile() {
		// TODO Auto-generated constructor stub
	}

	public ImportInvoiceFile(File f, String type) {
		super();
		this.file = f;
		Type = type;
	}

	public File getFile() {
		return file;
	}

	public void setFile(File f) {
		this.file = f;
	}

	public String getType() {
		return Type;
	}

	public void setType(String type) {
		Type = type;
	}

}
